import React from 'react';
import { View, StyleSheet } from 'react-native';
import NavigationStep from './NavigationStep';
const NavigationBar = () => {
    return (
        <View styles={styles.nav}>
            <NavigationStep/>
            <NavigationStep/>
        </View>
    )
}

const styles = StyleSheet.create({
    nav: {
        // margin: 'auto',
        display: 'flex',
        flexDirection: 'row',
        width: '100%'
    }
});

export default NavigationBar;
